import React from 'react';
import { View, Button, Text } from 'react-native';

const ButtonList = () => {
    let items: string[] =["Saved message","Look","Notification","Chat folders","Confidentiality","Language",];
    return <View>
    {items.map((item) => (
      <Button title={item}></Button>
    ))}
    </View>
}

export default ButtonList;
